export const colorhunt = createSlice({
    name: "colorhunt",
    initialState: {
        colors: ["blue", "green", "red", "pink", "black", "yellow", "grey", "orange", "white", "brown", "purple", "beige", "navy", "peach", "teal", "maroon"],
        collections: ["gold", "pastel", "dark", "neon", "skin", "rainbow", "retro", "vintage", "food", "summer", "light", "cream", "earth", "coffee", "nature", "warm", "spring", "night", "space", "winter", "sunset", "christmas", "kids", "happy", "cold", "fall", "wedding", "halloween"],
        result: [],
        myCollection: [],
        time: "month",
        myCreates: [],
    },
    reducers: {
        getResult: (state, action) => {
            switch (action.payload.page) {
                case "popular":
                    state.result = JSON.parse(JSON.stringify(data.month))
                    break;
                case "random":
                    state.result = JSON.parse(JSON.stringify(data.random))
                    break;
                case "palettes":
                    state.result = JSON.parse(JSON.stringify(data.new))
                    break;
                case undefined:
                    if (action.payload.filled === undefined) {
                        state.result = JSON.parse(JSON.stringify(data.new))
                    } else {
                        let filledArray = action.payload.filled.split("-");
                        state.result = JSON.parse(JSON.stringify(data[String(filledArray[0])]));
                        for (let i = 1; i < filledArray.length - 1; i++) {
                            let result = JSON.parse(JSON.stringify(data[String(filledArray[i])]));
                            state.result = state.result.filter(c => {
                                for (let i = 0; i < result.length; i++) {
                                    if (c.code === result[i].code) { return true }
                                }
                                return false;
                            })
                        }
                    }
                    break;
                default:
                    break;
            }
        },
        getCollection: (state, action) => {
            if (localStorage.getItem("collections") != null) {
                state.myCollection = JSON.parse(localStorage.getItem("collections"));
            }
        },
        getCreates: (state, action) => {
            if (localStorage.getItem("creates") != null) {
                state.myCreates = JSON.parse(localStorage.getItem("creates"));
                for (let k = 0; k < state.myCreates.length; k++) {
                    let colorBoard = state.myCreates[k];
                    for (let i = 0; i < colorBoard.filled.length; i++) {
                        data[String(colorBoard.filled[i])] = [colorBoard, ...data[String(colorBoard.filled[i])]];
                    }
                }
            }
        },
        addCollection: (state, action) => {
            state.myCollection = state.myCollection.concat([action.payload]);
            localStorage.setItem("collections", JSON.stringify(state.myCollection))
            document.getElementsByClassName("tongue")[0].classList.add("animate");
            setTimeout(() => {
                document.getElementsByClassName("tongue")[0].classList.remove("animate");
            }, 1000);
        },
        deleteCollection: (state, action) => {
            state.myCollection = state.myCollection.filter(c => c != action.payload)
            localStorage.setItem("collections", JSON.stringify(state.myCollection))
        },
        setTime: (state, action) => {
            state.time = action.payload;
            state.result = JSON.parse(JSON.stringify(data[String(action.payload)]))
        },
        addColor: (state, action) => {
            if (state.myCreates.findIndex(color => color.code == action.payload.code) == -1) {
                const colorBoard = {
                    code: action.payload.code,
                    likes: "Delete",
                    filled: action.payload.filled,
                    date: "Your created"
                }
                for (let i = 0; i < colorBoard.filled.length; i++) {
                    data[String(colorBoard.filled[i])] = [colorBoard, ...data[String(colorBoard.filled[i])]];
                }
                state.myCreates = [...state.myCreates, colorBoard]
                localStorage.setItem("creates", JSON.stringify(state.myCreates))
            }
        },
        deleteColor: (state, action) => {
            state.result = state.result.filter(color => color.code != action.payload)
            state.myCreates = state.myCreates.filter(color => color.code != action.payload)
            localStorage.setItem("creates", JSON.stringify(state.myCreates))
        },
    }
})
export default colorhunt.reducer;
